import React from 'react';
import ReactDOM from 'react-dom';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    Redirect
} from "react-router-dom";

export default class Dashboard extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            userinfo:null
        }

        this.redirectthing = this.redirectthing.bind(this)

    }

    redirectthing(){
        return(
            <Redirect to = '/login'/>


        )
    }

    render(){
        return(
            <div>
                <button onClick = {this.redirectthing}></button>
            </div>
        )
    }
}
